class Solution:
    def checkPalindromeFormation(self, a: str, b: str) -> bool:
        for i in range(len(a)):
            if self.isPalidrome(a[:i] + b[i:]) or self.isPalidrome(b[:i] + a[i:]):
                return True
        return False

    def isPalidrome(self, string: str) -> bool:
        for i in range(len(string) // 2):
            if string[i] != string[len(string) - i - 1]:
                return False
        return True


if __name__ == "__main__":
    print(Solution().isPalidrome('asdffdsa'))
    print(Solution().isPalidrome('asdfdsa'))
    print(Solution().isPalidrome(''))
    print(Solution().isPalidrome('asdfedsa'))

